import React from "react";
import { useContext , u } from "react";
import { StateContext } from "../../context/AppProvider";
import {DispatchContext} from '../../context/AppProvider'


const Checkout = () => {
  const Cartpakages = useContext(StateContext);
  const dispatch = useContext(DispatchContext)

  let cartpakageAre = Cartpakages.cartItems.map((item , index) => {

    return (
      <div>
        <h5>{item.title}</h5>
        <img src={item.img} alt="" />
        <h2>Rs:- {item.price}/-</h2>
        <h2> Quantity : {item.qty}  
          <button onClick={()=>{dispatch({
                type: 'minus-qty',
                payload:{
                  id:item.id
                }
              })}}>Minus</button>
          <button onClick={()=>{dispatch({
                type: 'add-qty',
                payload:{
                  id:item.id
                }
              })}}>Add</button>
        </h2>
        <h2 >Tottal Price : {item.totalprice}/-</h2>
        <h2>Buy Now</h2>
      </div>
    );
  });
  return (
    <section>
    <div>
      <div className="container">
        <div className="checkout-warper">
          <div className="checkout-warper-items">
            <h1>CheckOut Page</h1>

            {cartpakageAre}
          </div>
        </div>
      </div>
    </div>
    </section>
  );
};

export default Checkout;
